package com.ufgov.zc.server.bi.publish.impl.exporter;import java.util.List;import com.ufgov.zc.common.bi.publish.IBiCdTrackServiceDelegate;import com.ufgov.zc.common.system.RequestMeta;import com.ufgov.zc.common.system.dto.ElementConditionDto;import com.ufgov.zc.server.system.SpringContext;public class BiCdTrackServiceExporter implements IBiCdTrackServiceDelegate {  private IBiCdTrackServiceDelegate delegate = (IBiCdTrackServiceDelegate) SpringContext  .getBean("biCdTrackServiceDelegate");  public void carryDownFN(List biCdTrackList, RequestMeta requestMeta) {    this.delegate.carryDownFN(biCdTrackList, requestMeta);  }  public List getBiCdTrack(ElementConditionDto dto, RequestMeta requestMeta) {    return this.delegate.getBiCdTrack(dto, requestMeta);  }  public void auditFN(List biCdTrackList, RequestMeta requestMeta) {    this.delegate.auditFN(biCdTrackList, requestMeta);  }  public void blankoutFN(List biCdTrackList, RequestMeta requestMeta) {    this.delegate.blankoutFN(biCdTrackList, requestMeta);  }  public void unauditFN(List biCdTrackList, RequestMeta requestMeta) {    this.delegate.unauditFN(biCdTrackList, requestMeta);  }  public void untreadFN(List biCdTrackList, RequestMeta requestMeta) {    this.delegate.untreadFN(biCdTrackList, requestMeta);  }  public void importToNextYearFN(List biCdTrackList, RequestMeta requestMeta) {    this.delegate.importToNextYearFN(biCdTrackList, requestMeta);  }}